import SocDrop from "./socDrop";

function DropDown({turn, hidePhone, hidePhoneSpace, hideSoc, socSpace, atDrop}){


    const turnDisplay = () => {
        if(turn === "Phone"){
           <PhoneDrop hidePhone={hidePhone} hidePhoneSpace={hidePhoneSpace}/> 
        }else if(turn === "Social"){
            <SocDrop hideSoc={hideSoc} socSpace={socSpace} />
        } 
    }

    return(
        <div id={`dropDown${turn}`}>         
        </div>
    )

//end of component
};

export default DropDown;
